import React from "react";
import OrderShedule from "./OrderShedule";

let MainApp = (props) => {

    let aaaa = [{
        froms: 'dfdfddf',
        to: 'fdffdfsfdssdfsdf',
        date: 'Wed Jul 29 2020 16:52:31 GMT+0300 (Москва, стандартное время)',
        price: '123.3'
    }]

    return (
        <div>
            <h3>Мои заказы</h3>
            <div>
                <OrderShedule aaaa={aaaa} />
            </div>
        </div>
    )
}

export default MainApp;
